// SPDX-License-Identifier: MIT
pragma solidity ^0.8;
pragma experimental ABIEncoderV2;

contract SupplyChainNetwork {
    address public networkOwner = msg.sender;
    // struct Product {
    //     uint productId;
    //     string productName;
    //     bool exist;
    // }
    struct CompanyContract {
        uint id;
        address from;
        address to;
        uint productId;
    }
    struct CompanyProduct {
        address companyId;
        uint productId;
    }
    // struct Recipe {
    //     Product supply;
    //     Product[] prerequisites;
    //     uint[] quantities;
    // }
    struct Request {
        uint id;
        address from;
        address to;
        uint productId;
        uint quantity;
    }
    struct Supply {
        uint total;
        uint[] supplyId;
        uint[] quantities;
        bool exist;
    }
    struct PastSupply {
        uint[] pastSupply;
        bool exist;
    }
    struct Company {
        address owner;
        bool exist;
        string name;
        uint[] listOfSupply;
        uint[] listOfPrerequisites;
        address[] upstream;
        CompanyProduct[] downstream;
        Request[] incomingRequests;
        Request[] outgoingRequests;
        CompanyContract[] incomingContract;
        CompanyContract[] outgoingContract;
    }
    mapping(address => Company) public companies;
    mapping(address => mapping(uint => Supply)) public companySupplies;
